import sys

def solve():
    n, m = map(int, sys.stdin.readline().split())

    if m == 0:
        sys.stdout.write("YES\n")
        sys.stdout.write("1 " * n + "\n")
        return

    adj = [[] for _ in range(n + 1)]
    edges_data = []
    for _ in range(m):
        u, v, g, l = map(int, sys.stdin.readline().split())
        adj[u].append((v, g, l))
        adj[v].append((u, g, l))
        edges_data.append((u, v, g, l))

    ans = [0] * (n + 1)
    visited = [False] * (n + 1)

    def get_prime_factors(num):
        factors = {}
        d = 2
        temp = num
        while d * d <= temp:
            while temp % d == 0:
                factors[d] = factors.get(d, 0) + 1
                temp //= d
            d += 1
        if temp > 1:
            factors[temp] = factors.get(temp, 0) + 1
        return factors

    def merge_factors(factors1, factors2, op):
        res = {}
        all_primes = set(factors1.keys()).union(set(factors2.keys()))
        for p in all_primes:
            exp1 = factors1.get(p, 0)
            exp2 = factors2.get(p, 0)
            if op == 'gcd':
                res[p] = min(exp1, exp2)
            elif op == 'lcm':
                res[p] = max(exp1, exp2)
        return res

    def factors_to_num(factors):
        num = 1
        for p, exp in factors.items():
            num *= (p ** exp)
        return num

    def dfs(u, current_factors_map):
        visited[u] = True
        ans[u] = factors_to_num(current_factors_map)

        for v, g, l in adj[u]:
            if not visited[v]:
                if l % g != 0:
                    return False

                req_prod = l // g
                req_prod_factors = get_prime_factors(req_prod)

                v_factors = {}
                u_factors_num = ans[u]
                if u_factors_num == 0: # Should not happen if ans[u] is set
                    return False

                g_factors = get_prime_factors(g)
                l_factors = get_prime_factors(l)
                u_factors = get_prime_factors(u_factors_num)

                all_primes = set(u_factors.keys()).union(set(g_factors.keys())).union(set(l_factors.keys()))

                for p in all_primes:
                    u_exp = u_factors.get(p, 0)
                    g_exp = g_factors.get(p, 0)
                    l_exp = l_factors.get(p, 0)

                    # From gcd(u,v) = g and lcm(u,v) = l
                    # min(u_exp, v_exp) = g_exp
                    # max(u_exp, v_exp) = l_exp

                    if not (min(u_exp, l_exp) == g_exp and max(u_exp, l_exp) == l_exp):
                        return False

                    if u_exp == g_exp:
                        v_factors[p] = l_exp
                    elif u_exp == l_exp:
                        v_factors[p] = g_exp
                    else: # u_exp is between g_exp and l_exp, which is impossible if gcd and lcm are correct
                        return False

                if not dfs(v, v_factors):
                    return False
            else:
                # Verify consistency
                u_val = ans[u]
                v_val = ans[v]
                if u_val == 0 or v_val == 0:
                    return False
                if not (u_val // g == u_val // g and v_val // g == v_val // g):
                    return False
                if not (u_val % g == 0 and v_val % g == 0):
                    return False
                if not (u_val % g == 0 and v_val % g == 0 and u_val * v_val // g == l):
                    return False
        return True

    for i in range(1, n + 1):
        if not visited[i]:
            initial_val = 1
            ans[i] = initial_val
            initial_factors = get_prime_factors(initial_val)
            if not dfs(i, initial_factors):
                sys.stdout.write("NO\n")
                return

    # Final verification
    for u, v, g, l in edges_data:
        val_u = ans[u]
        val_v = ans[v]
        if val_u == 0 or val_v == 0: # Should not happen if DFS completes successfully
            sys.stdout.write("NO\n")
            return

        # Check GCD
        gcd_val = 1
        a, b = val_u, val_v
        while b:
            a, b = b, a % b
        gcd_val = a

        # Check LCM
        lcm_val = (val_u * val_v) // gcd_val

        if not (gcd_val == g and lcm_val == l):
            sys.stdout.write("NO\n")
            return

    sys.stdout.write("YES\n")
    sys.stdout.write(" ".join(map(str, ans[1:])) + "\n")

solve()
